import React, { useState, useEffect } from "react";

const priorityColor = { 'Haute': 'red', 'Moyenne': 'orange', 'Basse': 'green' };

function ContactBoard({ token }) {
  const [contacts, setContacts] = useState([]);

  // Charger contacts
  useEffect(() => {
    fetch("http://localhost:4000/contacts", {
      headers: { Authorization: "Bearer " + token },
    })
      .then((r) => r.json())
      .then(setContacts);
  }, [token]);

  // Ajouter contact
  async function addContact() {
    const name = prompt("Nom du contact ?");
    if (!name) return;
    const resp = await fetch("http://localhost:4000/contacts", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Bearer " + token,
      },
      body: JSON.stringify({
        name,
        type: "Organisation",
        priority: "Basse",
        status: "À contacter",
        notes: ""
      }),
    });
    if (resp.ok) setContacts(async (c) => [...c, await resp.json()]);
  }

  // Modifier contact (inline: status, priority, notes)
  async function updateContact(id, field, value) {
    const contact = contacts.find(c => c.id === id);
    if (!contact) return;
    const resp = await fetch(`http://localhost:4000/contacts/${id}`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Bearer " + token,
      },
      body: JSON.stringify({ [field]: value }),
    });
    if (resp.ok) {
      const updated = await resp.json();
      setContacts(contacts =>
        contacts.map(c => c.id === id ? updated : c)
      );
    }
  }

  // Supprimer contact
  async function removeContact(id) {
    if (!window.confirm("Supprimer ce contact ?")) return;
    const resp = await fetch(`http://localhost:4000/contacts/${id}`, {
      method: "DELETE",
      headers: { Authorization: "Bearer " + token },
    });
    if (resp.ok) setContacts(contacts => contacts.filter(c => c.id !== id));
  }

  return (
    <div>
      <h3>Contacts</h3>
      <button onClick={addContact}>Ajouter un contact</button>
      <ul>
        {contacts.map(c => (
          <li key={c.id} style={{ border: "1px solid #ddd", margin: 8, padding: 8 }}>
            <b>{c.name}</b> ({c.type})
            <span style={{
              color: priorityColor[c.priority],
              fontWeight: 'bold',
              marginLeft: 10
            }}>{c.priority}</span>
            <br />
            Statut :
            <select value={c.status}
              onChange={e => updateContact(c.id, "status", e.target.value)}
              style={{ marginLeft: 5 }}>
              <option>À contacter</option>
              <option>En contact</option>
              <option>En attente</option>
              <option>Terminé</option>
            </select>
            <br />
            Priorité :
            <select value={c.priority}
              onChange={e => updateContact(c.id, "priority", e.target.value)}
              style={{ marginLeft: 5 }}>
              <option>Haute</option>
              <option>Moyenne</option>
              <option>Basse</option>
            </select>
            <br />
            Notes :
            <textarea
              value={c.notes}
              onChange={e => updateContact(c.id, "notes", e.target.value)}
              style={{ width: "95%", minHeight: 30 }}
            />
            <button onClick={() => removeContact(c.id)} style={{ color: "red" }}>Supprimer</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ContactBoard;
